//@ts-nocheck
import React from "react";
import styled from "styled-components";
import CardButton from "../CardButton";
export interface LabelProps {
  className?: string;
  children?: any;
}
const Label: React.FC<LabelProps> = ({ className='flex-jc-center', label, value }) => (
  <CardButton className={` ${className} flex-jc-center `}>
    <div className="color-grey">{label}</div>
    <div>{value}</div>
  </CardButton>
);

const StyledLabel = styled.div`
  box-shadow: 0px 0px 10px ${(props) => props.theme.color.grey[200]};
  padding: 10px 20px;
  border-radius: 8px;
`;

export default Label;
